(6721, 2854, 0, 1, '中美协和 feat 7th Sine & Wizard', '代表中国参战，将版图扩张到美国地下。\r\n\r\nDistant Pham：\r\nhttp://www.myspace.com/distantpham \r\n\r\nResistanze：\r\nhttp://www.myspace.com/resistanze \r\n\r\nResistanze International Mixtape Vol.1： \r\nhttp://www.myspace.com/resistanzeinternational \r\n\r\n歌里的客串歌手都是来自美国的地下高人，7th sine,Wizard两人都来自Resistanze大联盟，7th sine就是这个联盟的创始人。Wizard则还分属于另一个组合Distant Pham。这首由Rhyme Bot组员Basehead制作的歌曲同时也会收录在Resistanze的国际Mixtape Vol.1里面来代表中国，这个Mixtape里还会有许多其他国家的说唱音乐包括希腊，法国，德国等。\r\n详情请点击： http://www.hiphop.cn/news/11138/\r\n\r\n\r\n', '0000-00-00 00:00:00', 0000, 15, 2, 2, 'Verse 1: (7th Sine) \r\nEccentric eclipse of thought, Venturing through the dart\r\noracle speaking art, pivitol peak the part\r\ncheck my narration peep the opperation facing \r\nEveryone, having patience till thers is peace between all nations\r\nnaw... abra cadabra now another cadaver\r\nPo stock piling all the data like it dont even matter\r\nI hit the tavern then its back to the cavern for sho\r\nScorching adverbs through the paragraph patterns i wrote\r\nHey yo my ink leave the paper tatted as it roll on the scroll\r\ni rep the DP the YR Nu Realm and the Soul\r\nno can hold me when unfolding the untold and the facts\r\n7th Sine Silver Paper Wix Rize completin the track\r\nand this that hip hop with a relevance a higher type intellegence\r\nemelished with the elements through everyday type developemets\r\nLA to New York Beijing to Shanghai\r\nUS China Unified its Resistanze WorldWide\r\n\r\nChorus: (7th Sine) \r\nInternational look how this hip hop has grown \r\nSpreadin all across the continents all over the globe\r\nIt aint gonna stop Yall like the tick from The Timer\r\nits Sine and Widz repin US Rhyme BOT Rep China\r\n\r\nVerse 2: (简单定律)\r\n我代表中国现在进行中美协和\r\n硬核进入你的房间 没枪战\r\n我们只是抢占你的思想 爆炸你的音箱\r\n我支持真实 你保持原始 你是我的瓷\r\n若不是，我无视你的存在\r\n这是现代的HIPHOP没有DIE 我将把他们带回来\r\nunderground永远不会死亡 这是根\r\n机械人，Resistanze打造system 这是灯\r\n照亮扭曲的果实 操90%的50分模式\r\n连根拔起的脖子\r\n我是Basehead in Rhyme BOT 重新定义MC\r\n兼并全世界各地的牛逼\r\n奢华禁令 危险区域 简单定律\r\n我们站一起的意义大于你苍白的音律\r\n拯救这个词 保持真实和原始\r\n坚持的留下 剩下的“Bring Da Fucking Ruckus!”\r\n\r\nChorus: (7th Sine) \r\nInternational look how this hip hop has grown \r\nSpreadin all across the continents all over the globe\r\nIt aint gonna stop Yall like the tick from The Timer\r\nits Sine and Widz repin US Rhyme BOT Rep China\r\n\r\n\r\nVerse 3:(奢华禁令）\r\n聯合 把每個rappa的心都連著 \r\n你別閒著 我練著這技術已經够了\r\n接著 你被我牽著 我成為賢者\r\n请叫我先生 我到達巔峰 捷足先登\r\n真正的天分無需辯證 \r\nHiphop本身就沒有紛爭\r\n等等 我想先把這些蠢驢丟進糞坑\r\n我是rhyme bot變身\r\n不斷練習 不會疲力\r\n為好作品我常犯病要用藥物維持鎮定\r\n神經病說唱說個不停 別說地下走不上國際\r\n你他媽的現在別和我談論什麽叫做藝術\r\n操你媽的回家去看看你daddy操的技術\r\n我攀上一個高度 跑上高速\r\n告訴你們hiphop没有国度 它在全世界漫步\r\n\r\n\r\nVerse 4: Wiz\r\nMy babble baffles international beats, defeat and dismantle the weak trample with speech, trample with sandals on feet\r\nhandling peace talks, walk the streets like we hard \r\nreally we lost deep, we create art and blow mcs apart \r\nDP started in Okinawa Japan, devouring Clans, powers advance \r\nrain shower the lands, the cowards? They ran\r\nhouses expand and explode whenever I flow I hold a rifle \r\nmy rightful place on the throne of bones and skeletons\r\nirrelevant lyricist fail to get the shit that we spit and sell kids nonsense in the form of hits, come on Wiz, you gotta be better than that better than rap ever could imagine or fathom these cats could ever match attack the wack and trap these cats who’s rap acts is just that… \r\nan act that has to bashed in the back of it’s head \r\nstabbed till its dead, back pack pad pencil with lead \r\nRap, come back from the dead and rep hip hop instead.\r\n\r\n\r\nChorus: (7th Sine) \r\nInternational look how this hip hop has grown \r\nSpreadin all across the continents all over the globe\r\nIt aint gonna stop Yall like the tick from The Timer\r\nits Sine and Widz repin US Rhyme BOT Rep China\r\n\r\n\r\n\r\n', '', 251, '', 'Beat: Basehead', '押韵机械人和Resistanze', '', '', '', 0, 1, 0, '2008-07-04 22:41:29', '2015-03-12 13:33:42', '0000-00-00 00:00:00'),
