(6724, 2884, 787, 2, 'Happy day', '', '2008-07-11 00:00:00', 0000, 30, 0, 4, '看看手機的簡訊 裡面有沒有妳 悄悄寄來的關心和嬌縱無理\r\n噗通跳動的心情 是因為妳 七八九月的天氣裡 溫暖無比\r\n \r\n如果你一個皺眉 我的世界就要倒大楣\r\n只要你一個笑顏 煩惱憂傷通通不見 \r\n\r\nHappy day 我的天 捨不得說再見 逾矩的吻 能否多一些\r\nHappy day 有一天 愛如潮水再也收不回\r\n如果真有那一天 我會微笑埋葬我的淚 \r\n\r\nHappy day 我的天 捨不得說再見 逾矩的吻 能否多一些 \r\nHappy day 有一天 白雪公主再也喚不回 \r\n掉落臺階的玻璃鞋 讓它永遠留在童話世界\r\n\r\n', '', 238, '', '波卡', '波卡', '', '', '', 0, 0, 0, '2008-07-06 03:05:39', '2015-03-12 13:33:42', '0000-00-00 00:00:00'),
(6725, 2884, 787, 3, '親愛的', '', '2008-07-11 00:00:00', 0000, 30, 0, 4, '旋轉木馬 摩天輪\r\n這座城市 牽我手走過每個角落\r\n是非對錯 愛的小手\r\n多期盼我 勇敢往前走\r\n\r\n想回到 小時後\r\n有妳陪伴著我 跌跌撞撞緊抓不放手\r\n\r\n親愛的 懷念妳擁抱的溫柔\r\n孤單徬徨放縱   我知道還有一個人會等我\r\n親愛的 如何表達思念\r\n 想牽著你的手  走過每一個春夏秋冬\r\n\r\n', '', 273, '', '波卡', '波卡  花花  小喬', '', '', '', 0, 0, 0, '2008-07-06 03:07:44', '2015-03-12 13:33:42', '0000-00-00 00:00:00'),
(6726, 2884, 787, 4, 'Delay', '', '2008-07-11 00:00:00', 0000, 30, 0, 4, '妳的出現 流浪終於畫下了句點 \r\n世界慢慢開始改變\r\n妳的道別 瞬間離開了我的視線\r\n無法停止我的想念\r\n\r\n怎麼能讓妳不見 我的世界開始DELAY\r\n沒有誰能取代妳的地位\r\n怎麼能讓我流淚 有人說過不再後悔\r\n玫瑰花漸漸的凋謝 \r\n\r\n', '', 257, '', '波卡', '小家', '', '', '', 1, 0, 0, '2008-07-06 03:09:59', '2015-03-12 13:33:42', '0000-00-00 00:00:00'),
(6727, 2925, 0, 1, '我不要知道', '', '2014-01-01 00:00:00', 0000, 15, 2, 1, '這表面的一切 複雜的陰鬱在迷惑邊緣 \n我不想面對這個世界 也不需要安慰 \n\n我不需要了解 也無須明白妳和他之間 \n也不想面對太多因為 也不需要明天 \n\n我不要知道 我不要知道 \n我不要知道 也無須明瞭 \n\n我不要知道..... 我不要知道 \n我不要知道..... 也無須明瞭 \n\n我不要知道 我不要知道 \n我不要知道 也無須明瞭 ', '', 276, '', '', '', '', '', '', 1, 0, 0, '2008-07-06 14:11:53', '2015-03-12 13:33:42', '0000-00-00 00:00:00'),
(6728, 2925, 0, 2, '灰色的妳灰色的我', '', '0000-00-00 00:00:00', 0000, 15, 1, 1, '無法 開口 妳說我們要怎麼過 \r\n無法 沉默 無法忘卻傷痛 \r\n\r\n習慣 不說 妳說這樣要過多久 \r\n陰鬱 傷痛 灰色的妳灰色的我 \r\n\r\n能不能夠 讓我們忘卻傷痛 \r\n是否我們 終究逃離不過 \r\n妳沉溺在 妳的灰色天空 \r\n\r\n灰色的妳灰色的我.....', '', 207, '', '', '', '', '', '', 1, 0, 0, '2008-07-06 14:27:05', '2015-03-12 13:33:42', '0000-00-00 00:00:00'),
