(6743, 1870, 710, 7, '國王的新衣', '總是想要隱藏某一些自己，卻總是像國王的新衣一般，騙到的只有自己而已。', '2008-06-23 00:00:00', 0000, 0, 2, 6, '試著藏匿轉移話題好引開注意\r\n卻無法躲避反射神經的誠實性\r\n變化形體再披上保護色系外衣\r\n我一定可以天衣無縫不露痕跡\r\n\r\n以為難懂的自己\r\n卻全天候赤裸身體\r\n只穿著國王的新衣\r\n\r\n反覆練習　只為能成為理想中的自己\r\n無法喊停　我自做多情的掩耳盜鈴\r\n\r\n故坐鎮定　只為保有一點祕密的安心\r\n請別介意　我自做多情的掩耳盜鈴\r\n', '', 214, '', 'marine', 'marine', '', '喜瑪拉雅', '', 0, 1, 0, '2008-07-07 19:41:35', '2015-03-12 13:33:42', '0000-00-00 00:00:00'),
(6744, 1870, 710, 7, 'ただ', '太多的話無法毫無顧忌地表達，即使用的是母語以外的語言。', '2008-06-23 00:00:00', 0000, 0, 2, 6, 'ちょっとお姉さんお願いします\r\nあんまり今日の天気良過ぎるじゃん\r\nよろしければ一緒にどうだ？\r\n一人ぼっちの寂しさが嫌\r\n\r\nちょっとお姉さんお願いします\r\n本当に今日の天気悪くてさ\r\nよろしければご一緒にどうだ？\r\n一人ぼっちにさせないから\r\n\r\n\r\nただ　ただ　ただ　ちょっと...あの...さ...\r\nただ　ただ　ただ\r\n\r\nただ　ただ　ただ　お腹空いた...\r\nただ　ただ　ただ　ちゃんと分かるかな…？\r\n\r\n\r\n＊＊＊＊＊＊＊＊\r\n\r\n那個啊　大姊姊　拜託一下\r\n今天的天氣可不是太好了點嗎？\r\n如果可以的話　要不要和我一起呢？\r\n因為我討厭一個人孤孤單單的感覺\r\n\r\n那個啊　大姊姊　拜託一下\r\n今天的天氣實在是糟糕透頂了\r\n如果可以的話　"和我一起"意下如何呢？\r\n因為我絕對不會讓妳孤孤單單一個人的\r\n\r\n\r\n只是　只是　　只是　有一點...那個...啊...\r\n只是　只是　　只是\r\n只是　只是　　只是　肚子餓了\r\n只是　只是　　只是　這樣子能懂嗎...？\r\n\r\n', '', 135, '', 'marine', 'marine', '', '喜瑪拉雅', '', 0, 1, 0, '2008-07-07 19:42:57', '2015-03-12 13:33:42', '0000-00-00 00:00:00'),
(6745, 1870, 710, 7, '水泥盒子', '手無寸鐵的渺小自己，無法阻止或改變在任何的一切。', '2008-06-23 00:00:00', 0000, 0, 2, 6, '停止鬥爭吧　停止情緒性逞強\r\n粗心的話　　將無意披上刺的盔甲\r\n\r\n停止揣測吧　停止讓主觀一昧坐大\r\n錯置了想像　錯失了一切可能選項\r\n\r\n\r\n摀住嘴巴卻阻止不了想法\r\n遮住了陽光卻依舊繼續生長發芽\r\n\r\n摀住嘴巴也阻止不了掙扎\r\n遮住了陽光卻依舊繼續生長發芽\r\n\r\n', '', 212, '', 'marine', 'marine', '', '喜瑪拉雅', '', 0, 1, 0, '2008-07-07 19:45:53', '2015-03-12 13:33:42', '0000-00-00 00:00:00'),
(6746, 1870, 710, 7, '黃色小巴士', '給８０年代的美好。給舞台上我們依舊追隨的搖滾巨星。', '2008-06-23 00:00:00', 0000, 0, 2, 6, '花格子裙子古董玩偶\r\n閃著金邊精巧優雅的夢\r\n黃色小巴士經過門口\r\n一招手就戴上太陽眼鏡去兜風\r\n\r\n條紋襯衫筆直領口\r\n騎著摩托車非常的拉風\r\n直到太陽下了山以後\r\n就牽著手到disco去跳舞喝酒\r\n\r\n\r\nshine for the star we waiting for\r\nla la la.....\r\nshine for the star we still follow\r\n要見證此刻你美好所有\r\n\r\n', '', 236, '', 'marine', 'marine', '', '喜瑪拉雅', '', 0, 1, 0, '2008-07-07 19:47:30', '2015-03-12 13:33:42', '0000-00-00 00:00:00'),
(6747, 1870, 710, 7, '青空', '雷雨後的天空出現了彩虹。\r\n什麼都會過去的，但是總會留下一下什麼在心頭。', '2008-06-23 00:00:00', 0000, 0, 2, 6, '在那之後你過著怎樣的生活\r\n當記憶之中的你我顯得陳舊\r\n閉上眼會否又看見你微笑招手\r\n在那樣的時刻我又該怎麼做\r\n\r\n\r\n雷雨後天空出現一道彩虹\r\n我卻被鬱悶的溼氣壓住了胸口\r\n梅雨後夏季晴朗無雲的青空\r\n我能否再帶著笑繼續往前走\r\n\r\n\r\n在那之後你過著怎樣的生活\r\n當記憶之中的你我消失無蹤\r\n閉上眼會否又看見你笑著開口\r\n說這樣的結果不該讓我獨自承受\r\n', '', 170, '', 'marine', 'marine', '', '喜瑪拉雅', '', 0, 1, 0, '2008-07-07 19:48:40', '2015-03-12 13:33:42', '0000-00-00 00:00:00'),
(6748, 1870, 710, 7, '話說過了　離開', '把話說得清楚明白，希望離開之後能見到一個　更瀟灑的自己。', '2008-06-23 00:00:00', 0000, 0, 2, 6, '你的冷默像一陣風　輕撫我的臉孔\r\n逝去的夢已經太多　遺憾還有\r\n太過湛藍的天空　　軟弱的我還看不透\r\n時間的鐘卻不停留　繼續走\r\n\r\n你的冷漠像一陣風　輕撫我的傷口\r\n失序的夢　　　　　還沒有誰能聽得懂\r\n太過盡興的時空　　讓我暈眩無力承受\r\n你的腳步卻不停留　繼續走\r\n\r\n\r\n話說過了　離開　　或說過了　從頭再來\r\n話說過了　離開　　話說過了　從頭再來\r\n\r\n', '', 326, '', 'marine', 'marine', '', '喜瑪拉雅', '', 0, 1, 0, '2008-07-07 19:50:01', '2015-03-12 13:33:43', '0000-00-00 00:00:00'),
(6749, 1870, 710, 7, '床邊故事', '希望失眠的朋友們都能好好地進入夢鄉，見到夢中等待你許久的公主。\r\n', '2008-06-23 00:00:00', 0000, 0, 2, 6, '沁涼夜晚之中月亮升空\r\n溫暖棉被讓你感到無比放鬆\r\n沈重眼皮裡頭羊群在等候\r\n等著依序跳過柵欄好引你入夢\r\n\r\n\r\n步出黑暗隧道口\r\n遍地開滿了可愛花朵\r\n突然想起少了什麼\r\n野餐盒忘在餐桌\r\n\r\n\r\n穿過蜿蜒小徑後\r\n看到童話般美麗皇宮\r\n公主站在門口微笑揮著手說\r\n說"你讓我等了好久"\r\n\r\n', '', 187, '', 'marine', 'marine', '', '喜瑪拉雅', '', 0, 1, 0, '2008-07-07 19:51:04', '2015-03-12 13:33:43', '0000-00-00 00:00:00'),
